def get_second_to_last_prime(numbers):

    def is_prime(n):
        if n <= 1:
            return False
        for i in range(2, int(math.sqrt(n)) + 1):
            if n % i == 0:
                return False
        return True
    prime_count = 1
    second_to_last_prime = None
